import React from 'react';

const Navbar = ({ active, onChange, onLogout }) => (
  <nav className="navbar">
    <div className="navbar-brand">
      <h2>EMS Dashboard</h2>
    </div>
    <div className="navbar-nav">
      <button className={`nav-link ${active==='dashboard'?'active':''}`} onClick={()=>onChange('dashboard')}>Dashboard</button>
      <button className={`nav-link ${active==='employees'?'active':''}`} onClick={()=>onChange('employees')}>Employees</button>
      <button className={`nav-link ${active==='tasks'?'active':''}`} onClick={()=>onChange('tasks')}>Tasks</button>
      <button className="btn btn--secondary btn--sm" onClick={onLogout}>Logout</button>
    </div>
  </nav>
);

export default Navbar;
